import React, { Fragment, useState } from "react";
import {
  BottomNavigation,
  BottomNavigationAction,
  Divider,
} from "@mui/material";
import InfoIcon from "@mui/icons-material/Info";
import FavoriteIcon from "@mui/icons-material/Favorite";
import PortraitIcon from "@mui/icons-material/Portrait";
import { Link } from "react-router-dom";
import ROUTES from "../../routes/ROUTES.js";

const FooterComponent = ({ isLoggedIn }) => {
  const [value, setValue] = useState(0);

  return (
    <Fragment>
      <Divider />
      <BottomNavigation
        showLabels
        value={value}
        onChange={(event, newValue) => {
          setValue(newValue);
        }}
      >
        {isLoggedout ? (
          <>
            <BottomNavigationAction
              label="About"
              icon={<InfoIcon />}
              component={Link}
              to={ROUTES.ABOUT}
            />
            <BottomNavigationAction
              label="Favorite Cards"
              icon={<FavoriteIcon />}
              component={Link}
              to={ROUTES.FAVCARD}
            />
            <BottomNavigationAction
              label="My Cards"
              icon={<PortraitIcon />}
              component={Link}
              to={ROUTES.MYCARDS}
            />
          </>
        ) : (
          <BottomNavigationAction
            label="About"
            icon={<InfoIcon />}
            component={Link}
            to={ROUTES.ABOUT}
          />
        )}
        {isLoggedIn(
          <>
            <BottomNavigationAction
              label="About"
              icon={<InfoIcon />}
              component={Link}
              to={ROUTES.ABOUT}
            />
            <BottomNavigationAction
              label="Favorite Cards"
              icon={<FavoriteIcon />}
              component={Link}
              to={ROUTES.FAVCARD}
            />
            <BottomNavigationAction
              label="My Cards"
              icon={<PortraitIcon />}
              component={Link}
              to={ROUTES.MYCARDS}
            />
          </>
        )(
          <BottomNavigationAction
            label="About"
            icon={<InfoIcon />}
            component={Link}
            to={ROUTES.ABOUT}
          />
        )}
      </BottomNavigation>
    </Fragment>
  );
};

export default FooterComponent;
